import React from "react";
import styled from "styled-components";

function Footer() {
  return (
    <Contariner>
      <Left></Left>
      <Center></Center>
      <Right></Right>
    </Contariner>
  );
}

const Contariner = styled.div`
  display: flex;
`;
const Left = styled.div`
  flex: 1;
`;
const Right = styled.div`
  flex: 1;
`;
const Center = styled.div`
  flex: 1;
`;

export default Footer;
